import Task from './Task'

const Tasks = (props) => {
  let tasks = props.tasks

  return (
    <>
      {
        tasks.map(task => {
          return (
            <Task
              key={task.id}
              task={task}
              isDeleting={props.isDeleting}
              onClick={() => props.change(task.id)}
            />
          )
        })
      }
    </>
  )
}

export default Tasks
